import React from "react";
import './Contacto.css'

const Contacto = () =>{
    return (
        <section className="contacto-contenedor">
            <h5>Contacto</h5>

            <div className="contacto-cont">
                <div style={{flex: 1}}></div>
                <div style={{flex: 1}}></div>
            </div>
        </section>
    )
}

export default Contacto;
